import React, {useState, useEffect} from 'react';
import '../styles/Header.css';
import NavMenu from './NavMenu.js';

const Header = () => {
  
  return (
    <header id="header">
        <img src="icons/ic_logo.png" alt="logo_game"/>
        <NavMenu direction='row'/>
    </header>
    );
  };
  
  export default Header;
